import React from 'react';
import { Button, Backdrop, AppBar, Box, Container } from '@material-ui/core';
import ButtonAppBar from '../components/buttonAppBar';
import { withStyles, responsiveFontSizes } from '@material-ui/core/styles';


const WrapperBox = withStyles({
  root: {
    background: '#92cfcf',
    width: '100%',
    height: '5000px',
    display: "table",
    zIndex: "unset"
  },
})(Box);

const StyledBoxBlue = withStyles({
  root: {
    background: '#92cfcf',
    width: '100%',
    minWidth: '100%',
    height: '600px',
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);

const StyledBoxWhite = withStyles({
  root: {
    background: '#FFFFFF',
    width: '100%',
    minWidth:'100%',
    height: '1300px',
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);

const HomeOptions = withStyles({
  root: {
    background: '#92cfcf',
    width: '100%',
    height: '200px',
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "25px",
    fontFamily: "Arial, Helvetica, sans-serif",
  },
})(Box);


const StyledButton = withStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);

const cta = ["Save", "Wearable Charity"]

const App = () => <WrapperBox>
                     <ButtonAppBar />
                     <StyledBoxBlue>
                      <h2>{cta.join('\n')}</h2>
                     </StyledBoxBlue>
                     <HomeOptions>
                        <a style={{marginRight: "150px"}}>Mission Statement</a>
                        <a style={{marginLeft: "150px"}}>Click to Shop</a>
                     </HomeOptions>
                      <div><StyledBoxWhite>
                       <h2>hello world</h2>
                       </StyledBoxWhite>
                      </div>
                   </WrapperBox>;

export default App;
